- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CAfter the Wyoming Democratic
    State Central Committee filed its original 12 Day Pre-General Report (10/1/10-10/13/10),
    we discovered additional transactions that occurred prior to October 14, 2010,
    but that we had not yet recorded. Thus we are filing this amended report to reflect
    the changes. This report is being amended to show a disbursement of $110.30 to
    Bank of the West that we overlooked at the time we filed the original report.
    This expenditure came to light after the end of the October 2010 when we received
    our bank statement, but we did not know about it when we filed our original 12
    Day Pre-General Report on October 21, 2010. In addition, we discovered an extra
    $200 in unitemized contributions on Line 11a that we inadvertently failed to record
    before we filed our original pre-General report, but now those contributions have
    been recorded, and the corrected amounts are reported in this amendment.  \n"
